import { Paper } from '@material-ui/core';
import { useEffect, useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TablePayment from './TablePayment'


const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
        flexWrap: 'wrap',
        '& > *': {
            margin: theme.spacing(1),
            width: theme.spacing(100),
            height: theme.spacing(16),
        },
    },
}));


function NedBetalingsPlansListe({ list ,tableTitle}) {
    const classes = useStyles()
    const [tableTList, setTableTList] = useState([])

    const newList = setTableTList(tableTList.concat(tableTitle))

    return (
        <div >
            {list.map(item => 
            <div className={classes.root}>
                {newList.map(title => <h2>{title}</h2>)}
                <TablePayment list={item}/>
            </div>
            )}
        </div>

    )

}
export default NedBetalingsPlansListe;
